import React, { useState } from 'react';

import {
    StyleSheet,
    View,
    Text,
    Pressable,
    SafeAreaView
  } from 'react-native';

const About = (props) => {
return (
    <SafeAreaView
    style={styles.body}  
    >
    <Text style={styles.text}>About Screen</Text>
    </SafeAreaView>
)
}

const styles=StyleSheet.create({
body:{
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center'
},

text:{
    fontSize: 40,
    fontWeight: 'bold',
}
})

export default About
